import banner1 from "../../Assets/images/blog-img-1.jpeg";
import banner2 from "../../Assets/images/slider-2.jpeg";
import banner3 from "../../Assets/images/grocery-banner-2.jpeg";
import banner4 from "../../Assets/images/grocery-banner.png";
import banner5 from "../../Assets/images/blog-img-2.jpeg";
import banner6 from "../../Assets/images/blog-img-2.jpeg";

export default function Home() {
  return (
    <>
      <div className="container-fluid bg-main ">
        <div className="row">
          <div className="col-md-8">
            <img className="w-100" src={banner0} alt="" />
          </div>

          <div className="col-md-4 ">
            <img className="w-100 " src={banner3} alt="" />{" "}
            <img className="w-100 pt-2" src={banner4} alt="" />
          </div>
          
      

          <div className="col-md-8 ">
            <img className="w-100" src={banner2} alt="" />
          </div>

          <div className="col-md-4 ">
            <img className="w-100 pt-2" src={banner5} alt="" />{" "}
            <img className="w-100 pt-2" src={banner6} alt="" />
          </div>
          
        </div>
      </div>
    </>
  );
}
